import "./App.css";

function App() {
	window.addEventListener("devicemotion", (event) => {
		console.log(event);
	});

	ondevicemotion = (event) => {
		console.log(event);
	};
	return <div className="App">{/* <h1>{handledLog}</h1> */}</div>;
}

export default App;
